function onTick() x,y,pressed=input.getNumber(3),input.getNumber(4),input.getBool(1) ifr=input.getBool(3) render=input.getBool(2) if pressed and ipir(x,y,1,1,17,7) then ifr2=true else ifr2=false end if pressed and ipir(x,y,56,1,7,5) then plus=true else plus=false end if pressed and ipir(x,y,49,1,7,5) then minus=true else minus=false end output.setBool(3,minus) output.setBool(2,plus) output.setBool(1,ifr2) end
function onDraw() if render then ac(ifr) screen.drawRectF(1,1,17,7) ac(plus) screen.drawRectF(56,1,7,5) ac(minus) screen.drawRectF(49,1,7,5)
screen.setColor(2,2,2) screen.drawTextBox(1,1,17,7,"IFR",0,0) screen.drawTextBox(56,1,7,5,"-",0,0) screen.drawTextBox(49,1,7,5,"+",0,0) end end function ipir(x, y, rectX, rectY, rectW, rectH) return x > rectX and y > rectY and x < rectX+rectW and y < rectY+rectH end function ac(active) if active then screen.setColor(0,100,15) else screen.setColor(180,180,180)end end

arm={"utility","incompatible","bomb","laser_bomb","gps_bomb","rocket","rocket pod","laser_missile","gps_missile","radar_missile","torpedo","cannon"}
--custom ordanance array
cus={"40mm CNN","20mm CNN","AGM62","AGM65","MK18","","","","MK18 RACK","","AGM71","AIM16","A16 RACK","","","AGM70FG","",""}
pod={"L1","L2","L3","C1","C2","R1","R2","R3"}
gn=input.getNumber gb=input.getBool sc=screen.setColor sb=output.setBool
function onTick()
t={gn(1),gn(3),gn(5),gn(7),gn(9),gn(11),gn(13),gn(15),gn(17),gn(19),gn(21),gn(23),gn(25)}
c={gn(2),gn(4),gn(6),gn(8),gn(10),gn(12),gn(14),gn(16),gn(18),gn(20),gn(22),gn(24),gn(26)}
b={gb(1),gb(2),gb(3),gb(4),gb(5),gb(6),gb(7),gb(8),gb(9),gb(10),gb(11),gb(12),gb(13)}
sel={gb(14),gb(15),gb(16),gb(17),gb(18),gb(19),gb(20),gb(21),gb(22),gb(23),gb(24),gb(25),gb(26)}
end
function onDraw()
sc(2,2,2) screen.drawClear()
for i=1,8 do
if t[i]==0 or t[i]==nil then sc(180,0,0) elseif sel[i] then sc(180,180,180) else sc(0,100,15) end
if b[i] then
screen.drawTextBox(13,-6+i*7,51,6,cus[c[i]],-1,0)
else
screen.drawTextBox(13,-6+i*7,51,6,arm[t[i]] or "empty",-1,0)
end
sc(180,180,180)
screen.drawText(0,-6+i*7,pod[i]..":")
end
end

function ipir(x, y, rectX, rectY, rectW, rectH)
	return x > rectX and y > rectY and x < rectX+rectW and y < rectY+rectH
end

gn=input.getNumber gb=input.getBool sc=screen.setColor sb=output.setBool
function onTick()
t={gn(1),gn(2),gn(3),gn(4),gn(5),gn(6),gn(7),gn(8),gn(9),gn(10),gn(11),gn(12),gn(13)}

b={gb(1),gb(2),gb(3),gb(4),gb(5),gb(6),gb(7),gb(8),gb(9),gb(10),gb(11),gb(12),gb(13)}
sel={gb(14),gb(15),gb(16),gb(17),gb(18),gb(19),gb(20),gb(21),gb(22),gb(23),gb(24),gb(25),gb(26)}
end
function onDraw()
for i=1,8 do
	if t[i]==0 or t[i]==nil then sc(20,20,20) elseif sel[i] then sc(180,180,180) else sc(0,100,15) end
	if t[i]==0 or t[i]==nil then
	screen.drawTextBox(0,-6+i*7,64,6," ",1,0)
	else
	screen.drawTextBox(0,-6+i*7,64,6,math.floor(t[i]),1,0)
	end
end
end

function ipir(x, y, rectX, rectY, rectW, rectH)
	return x > rectX and y > rectY and x < rectX+rectW and y < rectY+rectH
end
